import React, { Component } from 'react';
import Navbar from '../../navbar';
import Footer from "../../footer";
class about extends Component {
    render() {
        return (
            <div>
                <Navbar />
                <h1>About Front</h1>
                <Footer />
            </div>
        );
    }
}

export default about;
